import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    backgroundColor: theme.palette.background.paper,
  },
  gridList: {
    width: 500,
    height: 450,
  },
}));

const List = (props) => {
  const classes = useStyles();

  const { repos } = props;
  if (!repos || repos.length === 0) return <p>No repos, sorry</p>;
  return (
    <ul>
      <h2 className='list-head'>Available Public Repositories</h2>
      <GridList cellHeight={160} className={classes.gridList} cols={3}>
        {repos.map((repo) => (
          <GridListTile key={repo.flight_number} cols={repo.flight_number || 1}>
            <span className='repo-text'>{repo.flight_number} </span>
            <span className='repo-description'>{repo.mission_name}</span>
          </GridListTile>
        ))}
      </GridList>
      {repos.map((repo) => {
        return (
          <li key={repo.flight_number} className='list'>
            <span className='repo-text'>{repo.flight_number} </span>
            <span className='repo-description'>{repo.mission_name}</span>
          </li>
        );
      })}
    </ul>
  );
};
export default List;
